import React from "react";

const Slider = () => {
  return (
    <div className="container-fluid my-5">
      <button className=" bg-warning" type="button">
        <span className="carousel-control-prev-icon" aria-hidden="true"></span>
      </button>
      <button className="carousel-control-next" type="button">
        <span className="carousel-control-next-icon" aria-hidden="true"></span>
      </button>
      <div className="rows d-flex flex-row overflow-hidden">
        <div className="col-4 bg-dark">1</div>
        <div className="col-4 bg-white">2</div>
        <div className="col-4 bg-primary">3</div>
        <div className="col-4 bg-success">4</div>
        <div className="col-4 bg-success">4</div>
        <div className="col-4 bg-success">4</div>
        <div className="col-4 bg-success">4</div>
      </div>
    </div>
  );
};

export default Slider;
